s:9:"owner_pic";s:0:"";}i:91;a:1:{s:2:"id";s:19:"2391228617361471458";}i:92;a:1:{s:10:"short_code";s:11:"CEvWcIalDfi";}i:93;a:1:{s:12:"created_time";i:1599276686;}i:94;a:1:{s:7:"caption";s:2233:"É fácil parecer certo quando não se teve a chance de errar.

Quem procura, acha❓
Não acredite que seja bem assim.

A provocação ainda é um subproduto da insegurança; uma janela cercada por paredes vigilantes que se abre a um cenário elaborado; uma maquete de estímulos que desafia e insulta o experimento – dando a ele brechas de inverter vias, fazer-se de vítima, virar a vontade do avesso e acusar o investigador de conspirador.

A vontade reprimida só é vontade pela privação.

Ignora-se o sol em vinte dias de luz.
Deseja-se a luz em dois dias nublados. 

Mas, como se testam lobos sem privá-los da refeição, sem chacoalhar carne em sua frente❓

Soltando-o ao campo das possibilidades, sem o arquitetar das possibilidades.

Portanto, entrega à desconfiança
o chão, o bosque, a toca da presa.
Entrega à desconfiança todas as coisas, inclusive a chance de se provar verdade. 
Entrega, sem falar nada.
Sem fazer alusão a qualquer coisa.

No que o lobo afia o dente, já se sabe.
O que cabe é forrar o chão do covil com boa carne, da entrada à saída, e se comer o que há na entrada, tranca-se a saída; se comer o que há na saída, tranca-se a entrada.

E cuida. Cuida somente para que o teu recinto seja lugar de satisfação, sem se preocupar com o resto.

Quem busca por resto não é lobo;
teu covil não precisa de hienas. 

O lobo perseguido, torna-se arisco; “os desconfiados desafiam a traição.” (Voltaire)

Entrega a refeição junto a chave.
A liberdade é a possibilidade
de comprovar a lealdade. 

#PerOnore 

